import React, { useEffect, useState } from "react";
import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import { Link } from "react-router-dom";

import axios from "axios";

const MyDoctors = () => {
 
  const [doctors, setDoctors] = useState([]);
  const [name, setName] = useState("");
  const [username, setUsername] = useState("");
  const [hospitalName, setHospitalName] = useState("");
  const [department, setDepartment] = useState("");
  const [designation, setDesignation] = useState("");
  const [area, setArea] = useState("");

  const [query, setQuery] = useState();

  const loadDoctors = async () => {
    const url = "http://localhost:8000/patients/doctor-list";

    const res = axios
      .get(url, { params: query })
      .then((response) => {
        
        setDoctors(response.data.doctors);
        console.log(response.data.doctors[0].consultency[0]);
       
      })
      .catch((error) => {
        console.log(error);
      });
   
  };

  const doDoctorSearch = () => {
    setQuery({
      department: department,
      designation: designation,
      name: name,
      area: area,
    });
  };

  useEffect(() => {
   
    loadDoctors();
  }, [query]);

  
  return (
    <>
      <div className="grid grid-cols-3 gap-20 mx-auto max-w-7xl mt-20">
  <div>{/* First column content */}</div>
  <div className="flex flex-col items-center">
    {/* Second column content */}
    <h1 className="text-3xl font-bold mb-8">Current Doctors</h1>
    {doctors && doctors.length > 0 ? (
      doctors.map((doctor, index) => (
        <div key={index} className="bg-white shadow-lg rounded-lg w-96 mb-8">
          <img src="holder.js/100px180" alt="Doctor Image" className="w-full h-40 object-cover rounded-t-lg" />
          <div className="p-6">
            <h2 className="text-xl font-bold mb-2">{doctor.name}</h2>
            <p className="text-gray-700 mb-2">{doctor.department}</p>
            <p className="text-gray-700 mb-2">{doctor.designation}</p>
            <p className="text-gray-700 mb-2">Clinic: {doctor.consultency[0] ? doctor.consultency[0].clinic_name : 'Not available'}</p>
            <h5 className="font-bold">Visiting Hour :</h5>
            {doctor.consultency[0] && doctor.consultency[0].days ? (
              <p className="text-gray-700 mb-2">
                Days: {doctor.consultency[0].days.map(day => day.day).join(', ')}
              </p>
            ) : (
              <p className="text-gray-700 mb-2">Days: Not available</p>
            )}
            <p className="text-gray-700 mb-2">Start Time: {doctor.consultency[0] ? doctor.consultency[0].start_time : 'Not available'}</p>
            <p className="text-gray-700 mb-2">End Time: {doctor.consultency[0] ? doctor.consultency[0].end_time : 'Not available'}</p>
            <p className="text-gray-700 mb-2">Room: {doctor.consultency[0] ? doctor.consultency[0].room : 'Not available'}</p>
          </div>
        </div>
      ))
    ) : (
      <p>No doctors available</p>
    )}
  </div>
  <div className="flex flex-col justify-center items-center">
    {/* Third column content */}
    <form className="filter">
      <label htmlFor="doctorName" className="mb-4">Name</label>
      <input
        type="text"
        name="doctorName"
        id="doctorName"
        placeholder="Enter Doctor's Name"
        value={name}
        onChange={(e) => setName(e.target.value)}
        className="border border-gray-300 rounded-lg px-4 py-2 mb-4 w-72"
      />
      <label htmlFor="designation" className="mb-4">Designation</label>
      <input
        type="text"
        name="designation"
        id="designation"
        placeholder="Designation of Doctor"
        value={designation}
        onChange={(e) => setDesignation(e.target.value)}
        className="border border-gray-300 rounded-lg px-4 py-2 mb-4 w-72"
      />
      <label htmlFor="department" className="mb-4">Department</label>
      <input
        type="text"
        name="department"
        id="department"
        placeholder="Department"
        value={department}
        onChange={(e) => setDepartment(e.target.value)}
        className="border border-gray-300 rounded-lg px-4 py-2 mb-4 w-72"
      />
      <label htmlFor="area" className="mb-4">Area</label>
      <input
        type="text"
        name="area"
        id="area"
        placeholder="Doctor's Chamber's Area"
        value={area}
        onChange={(e) => setArea(e.target.value)}
        className="border border-gray-300 rounded-lg px-4 py-2 mb-4 w-72"
      />
      <button
        type="button"
        onClick={doDoctorSearch}
        className="bg-white text-blue-500 px-4 py-2 rounded-lg hover:bg-blue-500 hover:text-white transition duration-300 ease-in-out w-40"
      >
        Search
      </button>
    </form>
  </div>
</div>

    </>
  );
  
}

export default MyDoctors
